    //后端公钥
    private static String  PUBLIC_KEY ="0449e012a6375f188c16dc6e2e580923d284c5f977665494fb8967e4ec346366a2c285661b117d9e1a1322f20859774cc8068deafad05d336a8533a5be56ff0ed6";
    //后端私钥
    private  static String  PRIVATE_KEY = "00b75e99a216d7a39ad1def4bb558d8c6eba1f6d4dbcca4c86cf6d57853de12082";
    //前端公钥
    private static String  PUBLIC_KEY_WEB ="04896b80d07162d34d79ed8ede9f8d19a725a4452c244f22eac6b27eaf59e0cd94fc464a12e7e767083339d1e0c2bfc396187a1415b0b427cd072c6af2ff8dc7a5";
    // 前端私钥
    private static String  PRIVATE_KEY_WEB = "2a7289a405bab19e0970d1e938eb1fbe3e95b70055f3c4b34164357298b70827";

    /**
     * 公钥加密
     * @param data
     * @param isFront true使用前端公钥，用于加密数据发送给前端，false使用后端公钥，用于测试加密后的数据能否被后端私钥解密
     * @return
     */
    public static String encrypt2Data(String data, Boolean isFront) {
        String pubKey = PUBLIC_KEY;
        ECPrivateKeyParameters ecPrivateKeyParameters = BCUtil.toSm2Params(PRIVATE_KEY);
        if(isFront){
            pubKey = PUBLIC_KEY_WEB;
        }
        ECPublicKeyParameters ecPublicKeyParameters = null;
        if (StringUtils.isNotBlank(pubKey)) {
            if (pubKey.length() == 130) {
                //这里需要去掉开始第一个字节 第一个字节表示标记
                pubKey = pubKey.substring(2);
            }
            String xhex = pubKey.substring(0, 64);
            String yhex = pubKey.substring(64, 128);
            ecPublicKeyParameters = BCUtil.toSm2Params(xhex, yhex);
        }
        //创建sm2 对象
        SM2 sm2 = new SM2(ecPrivateKeyParameters, ecPublicKeyParameters);
        String dataHex = sm2.encryptBcd(data, KeyType.PublicKey);
        return dataHex;
    }

    /**
     * 私钥解密，用于解密前端加密传输过来的数据，前端必须使用后端公钥对数据进行加密
     * @param dataHex
     * @return
     */
    public static String decrypt2Data(String dataHex) {
        ECPrivateKeyParameters ecPrivateKeyParameters = BCUtil.toSm2Params(PRIVATE_KEY);
        ECPublicKeyParameters ecPublicKeyParameters = null;
        if (StringUtils.isNotBlank(PUBLIC_KEY)) {
            if (PUBLIC_KEY.length() == 130) {
                //这里需要去掉开始第一个字节 第一个字节表示标记
                PUBLIC_KEY = PUBLIC_KEY.substring(2);
            }
            String xhex = PUBLIC_KEY.substring(0, 64);
            String yhex = PUBLIC_KEY.substring(64, 128);
            ecPublicKeyParameters = BCUtil.toSm2Params(xhex, yhex);
        }
        //创建sm2 对象
        SM2 sm2 = new SM2(ecPrivateKeyParameters, ecPublicKeyParameters);
        String data = StrUtil.utf8Str(sm2.decryptFromBcd(dataHex, KeyType.PrivateKey));
        return data;
    }
    
    public static void getSM2Key() {
        SM2 sm2 = SmUtil.sm2();
        byte[] privateKeyByte = BCUtil.encodeECPrivateKey(sm2.getPrivateKey());
        //这里公钥不压缩  公钥的第一个字节用于表示是否压缩  可以不要
        byte[] publicKeyByte = ((BCECPublicKey) sm2.getPublicKey()).getQ().getEncoded(false);
        String privateKey = HexUtil.encodeHexStr(privateKeyByte);
        String publicKey = HexUtil.encodeHexStr(publicKeyByte);
        System.out.println(privateKey);
        System.out.println(publicKey);
    }

